import react from 'react';
import img from './'
import Component from '../Component';


const About=()=>{


    return (
        <>
              <Component Img={img}
                    Title="grow your business with"   
                    Name="SUBHAM SAHOO"   
                    Para="We are team of talented developer making websites" 
                    Anchor="Get Started"  
                    link="/service"           
            />
        </>
    )
}

export default About;
